import React from "react";
import "./style.css";

const Hotel = () => {
  return (
    <>
      <div className="nav">
        <div className="nav-container">
          <img src="" alt="" />
          <h1 className="head">ColorFlip</h1>
          <div className="menu">
              <ul>
                  <li><a href="index.html">Simple</a></li>
                  <li><a href="Hex.html">Hex</a></li>
              </ul>
          </div>

        </div>
      </div>
      <div className="main">
                <h1>Back-Ground Color : <span id="color">color</span>
                </h1>
      </div>
    </>
  );
};

export default Hotel;
